import React from 'react';

const CategorySection = () => {
  return (
    <section className="container mx-auto my-8 text-center flex just">
        <div>
      <h2 className="text-2xl font-bold mb-4">Ready to Dive into HABOT?</h2>
      <p className="text-gray-600">Find suppliers, buyers, or new opportunities.</p>
      </div>
      <div className="flex justify-center mt-4 space-x-2">
        <button className="btn btn-outline-primary">All</button>
        <button className="btn btn-outline-primary">Buyers</button>
        <button className="btn btn-outline-primary">Suppliers</button>
        <button className="btn btn-outline-primary">New</button>
      </div>
    </section>
  );
};

export default CategorySection;
